<http://kg.scania.com/part#> rdf:type owl:Ontology ;
                              dct:description "Ontology for all information related to parts that constitutes a vehicle."@en ;
                              dct:title "Part Ontology"@en ;
                              <http://www.linkedmodel.org/1.2/schema/vaem#namespace> <http://kg.scania.com/part#> ;
                              rdfs:label "Vehicle Part"@en .

#################################################################
#    Annotation properties
#################################################################

###  http://kg.scania.com/core/timestamp
core:timestamp rdf:type owl:AnnotationProperty .


###  http://kg.scania.com/part#toBeImplemented
:toBeImplemented rdf:type owl:AnnotationProperty ;
                 core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                 rdfs:comment "some relation between part that will be implemented"@en ;
                 rdfs:label "to be implemented"@en .


###  http://purl.org/dc/terms/description
dct:description rdf:type owl:AnnotationProperty .


###  http://purl.org/dc/terms/title
dct:title rdf:type owl:AnnotationProperty .


###  http://www.linkedmodel.org/1.2/schema/vaem#namespace
<http://www.linkedmodel.org/1.2/schema/vaem#namespace> rdf:type owl:AnnotationProperty .


###  http://www.w3.org/2004/02/skos/core#altLabel
skos:altLabel rdf:type owl:AnnotationProperty .


###  http://www.w3.org/2004/02/skos/core#prefLabel
skos:prefLabel rdf:type owl:AnnotationProperty .


#################################################################
#    Datatypes
#################################################################

###  http://qudt.org/vocab/unit/GM
unit:GM rdf:type rdfs:Datatype ;
        rdfs:comment "weight unit gram"@en ;
        rdfs:label "Gram"@en .


###  http://www.w3.org/2001/XMLSchema#date
xsd:date rdf:type rdfs:Datatype ;
         rdfs:comment "data type for date, YYYY-MM-DD"@en ;
         rdfs:label "date"@en .


#################################################################
#    Object Properties
#################################################################

###  http://kg.scania.com/part#byDesignGroup
:byDesignGroup rdf:type owl:ObjectProperty ;
               rdfs:domain :Part ;
               rdfs:range :DesignGroup ;
               core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
               rdfs:comment "What design group has introduced the Part."@en ;
               rdfs:label "by design group"@en .


###  http://kg.scania.com/part#consistsOfMaterial
:consistsOfMaterial rdf:type owl:ObjectProperty ;
                    rdfs:domain :Material ;
                    rdfs:range :Material ;
                    core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                    rdfs:comment "Relation indicating which (other) material(s) a material consists of."@en ;
                    rdfs:label "consists of material"@en .


###  http://kg.scania.com/part#demandDate
:demandDate rdf:type owl:ObjectProperty ;
            rdfs:domain :Demand .


###  http://kg.scania.com/part#forConsumingUnit
:forConsumingUnit rdf:type owl:ObjectProperty ;
                  rdfs:domain :Demand ;
                  rdfs:range contract:ConsumingUnit ;
                  core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                  rdfs:comment "Specification for consuming unit (PRU) for a given demand."@en ;
                  rdfs:label "for consuming unit"@en .


###  http://kg.scania.com/part#hasContract
:hasContract rdf:type owl:ObjectProperty ;
             rdfs:domain :Part ;
             rdfs:range contract:Contract ;
             core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
             rdfs:comment "Contract for a given Part."@en ;
             rdfs:label "has contract"@en .


###  http://kg.scania.com/part#hasDefiningDocument
:hasDefiningDocument rdf:type owl:ObjectProperty ;
                     rdfs:domain :Part ;
                     rdfs:range contract:DefiningDocument ;
                     core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                     rdfs:comment "Defining document for a given part."@en ;
                     rdfs:label "has defining document"@en .

###  http://kg.scania.com/part#hasPartFamily
:hasPartFamily rdf:type owl:ObjectProperty ;
                     rdfs:domain :Part ;
                     rdfs:range :PartFamily ;
                     core:timestamp "2023-01-20T09:09:00"^^xsd:dateTime ;
                     rdfs:comment "Part family for a given part."@en ;
                     rdfs:label "has part family"@en .

###  http://kg.scania.com/part#hasPartFamilyMember
:hasPartFamilyMember rdf:type owl:ObjectProperty ;
                     rdfs:domain :PartFamily ;
                     rdfs:range :Part ;
                     core:timestamp "2023-01-27T12:26:00"^^xsd:dateTime ;
                     rdfs:comment "Part family member for a given part family."@en ;
                     rdfs:label "has part family member"@en .


###  http://kg.scania.com/part#hasDiscontinuedSparePartCode
:hasDiscontinuedSparePartCode rdf:type owl:ObjectProperty ;
                              rdfs:domain :Part ;
                              rdfs:range :DiscontinuedSparePartCode ;
                              core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                              rdfs:comment "dspc (if any) connected to a part"@en ;
                              rdfs:label "has discontinued spare part code"@en .


###  http://kg.scania.com/part#hasMaterial
:hasMaterial rdf:type owl:ObjectProperty ;
             rdfs:domain :Part ;
             rdfs:range :Material ;
             core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
             rdfs:comment "Type of material a part has."@en ;
             rdfs:label "has material"@en .


###  http://kg.scania.com/part#hasPartDemand
:hasPartDemand rdf:type owl:ObjectProperty ;
               rdfs:domain :Part ;
               rdfs:range :Demand ;
               core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
               rdfs:comment "Demand for the part based on sourcing area."@en ;
               rdfs:label "has part demand"@en .


###  http://kg.scania.com/part#hasSourcingArea
:hasSourcingArea rdf:type owl:ObjectProperty ;
                 rdfs:domain :Part ;
                 rdfs:range contract:SourcingArea ;
                 core:timestamp "2023-01-04T14:00:00"^^xsd:dateTime ;
                 rdfs:comment "The sourcing area for a given part."@en ;
                 rdfs:label "has sourcing area"@en .


###  http://kg.scania.com/part#hasStatus
:hasStatus rdf:type owl:ObjectProperty ;
           rdfs:domain :Part ;
           rdfs:range :Status ;
           core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
           rdfs:comment "Status for a part."@en ;
           rdfs:label "has status"@en .


###  http://kg.scania.com/part#hasUnitOfMeasure
:hasUnitOfMeasure rdf:type owl:ObjectProperty ;
                  rdfs:domain :Part ;
                  rdfs:range :UnitOfMeasure ;
                  core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                  rdfs:comment "Unit of measure established for a part."@en ;
                  rdfs:label "has unit of measure"@en .


###  http://kg.scania.com/part#inSourcingArea
:inSourcingArea rdf:type owl:ObjectProperty ;
                rdfs:domain :Demand ;
                rdfs:range contract:SourcingArea ;
                core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                rdfs:comment "The sourcing area for a given demand."@en ;
                rdfs:label "in sourcing area"@en .


###  http://kg.scania.com/part#purchasedBy
:purchasedBy rdf:type owl:ObjectProperty ;
             rdfs:domain :Part ;
             rdfs:range contract:Purchaser ;
             core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
             rdfs:comment "Purchaser for a part."@en ;
             rdfs:label "purchased by"@en .


###  http://kg.scania.com/part#similarToPart
:similarToPart rdf:type owl:ObjectProperty ,
                        owl:SymmetricProperty ;
               rdfs:domain :Part ;
               rdfs:range :Part ;
               core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
               rdfs:comment "Relationship between two similar parts. Similarity is defined by purchasers."@en ;
               rdfs:label "similar to part"@en .


#################################################################
#    Data properties
#################################################################

###  http://kg.scania.com/contract#forConsumingUnit
contract:forConsumingUnit rdf:type owl:DatatypeProperty ;
                          rdfs:domain :Demand ;
                          rdfs:range xsd:string ;
                          rdfs:comment "What consuming unit (PRU) the demand is for."@en ;
                          rdfs:label "for consuming unit"@en .


###  http://kg.scania.com/part#calculatedWeight
:calculatedWeight rdf:type owl:DatatypeProperty ;
                  rdfs:subPropertyOf :weight ;
                  rdfs:domain :Part ;
                  rdfs:range unit:GM ;
                  core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                  rdfs:comment "The weight of a part or assembly that has been calculated by the design tool based on approved material specifications. Never used in Weight Calculation."@en ;
                  rdfs:label "calculated weight"@en .


###  http://kg.scania.com/part#demandDate
:demandDate rdf:type owl:DatatypeProperty ;
            rdfs:range xsd:dateTime .


###  http://kg.scania.com/part#demandQuantity
:demandQuantity rdf:type owl:DatatypeProperty ;
                rdfs:domain :Demand ;
                rdfs:range xsd:integer ;
                core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                rdfs:comment "Estimated quantity of demand."@en ;
                rdfs:label "demand quantity"@en .


###  http://kg.scania.com/part#designerResponsible
:designerResponsible rdf:type owl:DatatypeProperty ;
                     rdfs:domain :Part ;
                     rdfs:range xsd:string ;
                     core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                     rdfs:comment "The name or identity of the deigner person responsible for a part."@en ;
                     rdfs:label "designer responsible"@en .


###  http://kg.scania.com/part#dspCode
:dspCode rdf:type owl:DatatypeProperty ;
         rdfs:domain :DiscontinuedSparePartCode ;
         rdfs:range xsd:string ;
         core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
         rdfs:comment "The change order number that implements discontinuation of the object."@en ;
         rdfs:label "DSP code"@en .


###  http://kg.scania.com/part#estimatedWeight
:estimatedWeight rdf:type owl:DatatypeProperty ;
                 rdfs:subPropertyOf :weight ;
                 rdfs:domain :Part ;
                 rdfs:range unit:GM ;
                 core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                 rdfs:comment "An approximation of the weight of a part or assembly based on estimation, calculation, or judgement."@en ;
                 rdfs:label "estimated weight"@en .


###  http://kg.scania.com/part#hasDrawingFromOAS
:hasDrawingFromOAS rdf:type owl:DatatypeProperty ;
                   rdfs:domain :Part ;
                   rdfs:range xsd:string ;
                   core:timestamp "2023-01-06T10:30:00"^^xsd:dateTime ;
                   rdfs:comment "What OAS drawing ID a part has."@en ;
                   rdfs:label "has drawing from OAS"@en .


###  http://kg.scania.com/part#hasIntroCo
:hasIntroCo rdf:type owl:DatatypeProperty ;
            rdfs:domain :Part ;
            rdfs:range xsd:string ;
            core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
            rdfs:comment "ECO used for introduction. 6-digit code."@en ;
            rdfs:label "has intro CO"@en .


###  http://kg.scania.com/part#hasLastCO
:hasLastCO rdf:type owl:DatatypeProperty ;
           rdfs:domain :Part ;
           rdfs:range xsd:string ;
           core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
           rdfs:comment "The last CO affecting the drawing. 6-digit code."@en ;
           rdfs:label "has last CO"@en .


###  http://kg.scania.com/part#hasStandard
:hasStandard rdf:type owl:DatatypeProperty ;
             rdfs:domain :Part ;
             rdfs:range xsd:string ;
             core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
             rdfs:comment "Standard ID the part belongs to (if any)."@en ;
             rdfs:label "has standard"@en .


###  http://kg.scania.com/part#materialFromOAS
:materialFromOAS rdf:type owl:DatatypeProperty ;
                 rdfs:domain :Part ;
                 rdfs:range xsd:string ;
                 core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                 rdfs:comment "Raw material string input from OAS."@en ;
                 rdfs:label "material from OAS"@en .


###  http://kg.scania.com/part#materialGroup
:materialGroup rdf:type owl:DatatypeProperty ;
               rdfs:domain :Material ;
               rdfs:range xsd:string ;
               core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
               rdfs:comment "Code / number for material group a part belongs to."@en ;
               rdfs:label "material group"@en .


###  http://kg.scania.com/part#measuredWeight
:measuredWeight rdf:type owl:DatatypeProperty ;
                rdfs:subPropertyOf :weight ;
                rdfs:domain :Part ;
                rdfs:range unit:GM ;
                core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                rdfs:comment "The Measured Weight is the final, verified weight of a part or assembly. This weight can be determined either by direct measurement (that is, weighing on a scale) or by other appropriate methods."@en ;
                rdfs:label "measured weight"@en .


###  http://kg.scania.com/part#name
:name rdf:type owl:DatatypeProperty ;
      rdfs:range xsd:string ;
      core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
      rdfs:comment "all type of names for parts"@en ;
      rdfs:label "name"@en ,
                 "namn"@sv ,
                 "navn"@no .


###  http://kg.scania.com/part#nameLong
:nameLong rdf:type owl:DatatypeProperty ;
          rdfs:subPropertyOf :name ;
          rdfs:domain :Part ;
          rdfs:range xsd:string ;
          core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
          rdfs:comment "Denomination in long form."@en ;
          rdfs:label "name long"@en .


###  http://kg.scania.com/part#nameShort
