           rdfs:subPropertyOf :name ;
           rdfs:domain :Part ;
           rdfs:range xsd:string ;
           core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
           rdfs:comment "Denomination in short form"@en ;
           rdfs:label "name short"@en .


###  http://kg.scania.com/part#partNumber
