            rdfs:domain :Part ;
            rdfs:range xsd:string ;
            core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
            rdfs:comment "part number ID"@en ;
            rdfs:label "part number"@en .


###  http://kg.scania.com/part#statusCode
:statusCode rdf:type owl:DatatypeProperty ;
            rdfs:domain :Status ;
            rdfs:range xsd:string ;
            core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
            rdfs:comment "Code for status of a contract."@en ;
            rdfs:label "status code"@en .


###  http://kg.scania.com/part#supplierWeight
:supplierWeight rdf:type owl:DatatypeProperty ;
                rdfs:subPropertyOf :weight ;
                rdfs:domain :Part ;
                rdfs:range unit:GM ;
                core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
                rdfs:comment "The weight of a part or assembly as measured and reported by the supplier in their submitted Material Data Sheet (MDS) via the International Material Data System (IMDS). Only the data from the latest, Scania accepted MDS is shown."@en ;
                rdfs:label "supplier weight"@en .


###  http://kg.scania.com/part#unitCode
