          rdfs:domain :UnitOfMeasure ;
          rdfs:range xsd:string ;
          core:timestamp "2023-01-04T10:10:00"^^xsd:dateTime ;
          rdfs:comment "Code for unit of measure."@en ;
          rdfs:label "unit code"@en .


