data_httpbody = getValues(data_inputparams.getAt("demandDetails"),jsonSlurper)
data_outputparams = jsonSlurper.parseText(outputParameters)


def getValues(List list,JsonSlurper jsonSlurper){
    paramValuesList = []
    for(Map map:list) {
        map.each {
            key,value ->
                for(String valueList:((ArrayList)jsonSlurper.parseText(value))){
                    paramValuesList.add(valueList)
                }
        }
    }
    return paramValuesList
}

def createResultParameter(String subjectIri, HashMap<String, String> keyValue) {
    resultValue = [:]
    keyValue.each { key, value ->
        resultValue.put(key, value)
    }
    result.put(subjectIri, resultValue)
}

//Main function
def main(JsonSlurper jsonSlurper) {
    Gson gson = new Gson();
    mapGraph = [:]
    httpBody = ""
    resultList = []
    Dataset ds = DatasetFactory.createTxnMem() ;
    for(String res:data_httpbody) {
        mapGraph["@context"] = ctx
        paramValuesList = []
        paramValuesList.add(jsonSlurper.parseText(res))
        mapGraph["@graph"] = paramValuesList
        resultString = gson.toJson(mapGraph, Map.class);
        InputStream is = IOUtils.toInputStream(resultString, "UTF-8");
        RDFParser.source(is).lang(RDFLanguages.JSONLD)
                .parse(ds);
        qry = "PREFIX : <http://kg.scania.com/part#>\n" +
                "PREFIX contract: <http://kg.scania.com/contract#>\n" +
                "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>\n" +
                "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n" +
                "PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>\n" +
                "PREFIX unit: <http://qudt.org/vocab/unit/>\n" +
                "PREFIX skos: <http://www.w3.org/2004/02/skos/core#>\n" +
                "PREFIX time: <https://www.w3.org/TR/owl-time/#>\n" +
                "\n" +
                "# Demand\n" +
                "\n" +
                "CONSTRUCT {\n" +
                "      ?Part :partNumber ?part_number ;\n" +
                "            :hasPartDemand [:demandDate ?demand_date ;\n" +
                "                             :inSourcingArea contract:SourcingArea_SEU ;\n" +
                "                             :forConsumingUnit ?SEU_PRU ;\n" +
                "                             :demandQuantity ?SEU_PRU_demand] ,\n" +
                "                            [:demandDate ?demand_date ;\n" +
                "                             :inSourcingArea contract:SourcingArea_SLA ;\n" +
                "                             :forConsumingUnit ?SLA_PRU ;\n" +
                "                             :demandQuantity ?SLA_PRU_demand] ,\n" +
                "                            [:demandDate ?demand_date ;\n" +
                "                             :inSourcingArea contract:SourcingArea_SAS ;\n" +
                "                             :forConsumingUnit ?SAS_PRU ;\n" +
                "                             :demandQuantity ?SAS_PRU_demand]\n" +
                "            .\n" +
                "    ?SEU_PRU a contract:ConsumingUnit ;\n" +
                "            rdfs:label ?SEU_PRU_label .\n" +
                "    ?SLA_PRU a contract:ConsumingUnit ;\n" +
                "            rdfs:label ?SLA_PRU_label .\n" +
                "    ?SAS_PRU a contract:ConsumingUnit ;\n" +
                "            rdfs:label ?SAS_PRU_label .\n" +
                "}\n" +
                "\n" +
                "WHERE {\n" +
                "      ?sub :data [:result ?demand] .\n" +
                "\n" +
                "      ?demand :PartNumber ?part_number_int ;\n" +
                "              :DemandDate ?date .\n" +
                "      BIND(str(?part_number_int) as ?part_number)\n" +
                "      OPTIONAL {?demand :Total_Quantity ?tot_demand .}\n" +
                "      OPTIONAL {?demand :SEU [?SEU_PRU ?SEU_PRU_demand] .\n" +
                "                BIND(strlang(strafter(str(?SEU_PRU), \"/part#\"), \"en\") as ?SEU_PRU_label)}\n" +
                "      OPTIONAL {?demand :SLA [?SLA_PRU ?SLA_PRU_demand] .\n" +
                "                BIND(strlang(strafter(str(?SLA_PRU), \"/part#\"), \"en\") as ?SLA_PRU_label)}\n" +
                "      OPTIONAL {?demand :SAS [?SAS_PRU ?SAS_PRU_demand] .\n" +
                "                BIND(strlang(strafter(str(?SAS_PRU), \"/part#\"), \"en\") as ?SAS_PRU_label)}\n" +
                "\n" +
                "      # BIND(str(?date) as ?demand_date)\n" +
                "      BIND(substr(str(?date), 1,2) as ?dd)\n" +
                "      BIND(substr(str(?date), 4,2) as ?mm)\n" +
                "      BIND(substr(str(?date), 7,4) as ?YYYY)\n" +
                "      BIND(STRDT(STR(concat(?YYYY,\"-\", ?mm, '-', ?dd)), time:inXSDDate) as ?demand_date)\n" +
                "\n" +
                "      BIND(URI(CONCAT(\"http://kg.scania.com/part#Part_\", str(?part_number))) as ?Part)\n" +
                "}\n";

        Query query = QueryFactory.create(qry);
        ds.begin(ReadWrite.READ);
        try {
            QueryExecution qexec = QueryExecutionFactory.create(query, ds);
            Model modelresult = qexec.execConstruct();
            StringWriter out = new StringWriter();
            RDFDataMgr.write(out, modelresult, Lang.JSONLD);
            httpBody = out.toString();
            //System.out.println(out.toString());
            qexec.close();
        } finally {
            ds.end();
        }
        resultList.add(httpBody)
        resultmap = [:]
        resultmap.put("httpBody", resultList)

        createResultParameter(data_outputparams.get("param_demandDetails_stardog"), resultmap)
    }
}

main(jsonSlurper)
return result
